import React from "react";

const Navigation = ({ onSignOut, routeChange, signedIn }) => {
  return (
    <nav className="flex w-100 flex-row justify-end ma2">
      <p
        style={{
          display: "flex",
          padding: "0 10px 0 0",
        }}
        className="dib ma2 f4 self-start avenir dim pointer"
        onClick={() => routeChange("home")}
      >
        Home
      </p>
      <p
        style={{
          display: "flex",
          justifyContent: "flex-end",
          padding: "0 10px 0 0",
        }}
        className="dib ma2 f4 avenir dim pointer"
        onClick={() => (signedIn ? onSignOut() : routeChange("signIn"))}
      >
        {signedIn ? "Sign Out" : "Sign in"}
      </p>
      {!signedIn ? (
        <p
          style={{
            display: "flex",
            justifyContent: "flex-end",
            padding: "0 10px 0 0",
          }}
          className="dib ma2 f4 avenir dim pointer"
          onClick={() => routeChange("signUp")}
        >
          Sign up
        </p>
      ) : null}
    </nav>
  );
};
export default Navigation;
